int
main (int,char**)
{
  const double x=1.0,y=1.0,z=1.0;
  const double dt = 0.001;

  double x1=x,y1=y,z1=z;
  double x2=x,y2=y,z2=z;
  double x3=x,y3=y,z3=z;
  double x4=x,y4=y,z4=z;

  double current_time = 0.;

  std::ofstream of1("rk33_ref.dat"), of2("lrk33_ref.dat"), of3("lrk33p3_ref.dat"), of4("lrk33p9_ref.dat");
  of1 << current_time << " " << x1 << " " << y1 << " " << z1 << "\n";
  of2 << current_time << " " << x2 << " " << y2 << " " << z2 << "\n";
  of3 << current_time << " " << x3 << " " << y3 << " " << z3 << "\n";

  while ( current_time < 100. ) {
    current_time += dt;

    std::tie(x1,y1,z1) = rk33_iter(x1,y1,z1,dt);
    std::tie(x2,y2,z2) = lawson_rk33_iter(x2,y2,z2,dt);
    std::tie(x3,y3,z3) = lawson_rk33_pade33_iter(x3,y3,z3,dt);
    std::tie(x4,y4,z4) = lawson_rk33_pade99_iter(x4,y4,z4,dt);

    of1 << current_time << " " << x1 << " " << y1 << " " << z1 << "\n";
    of2 << current_time << " " << x2 << " " << y2 << " " << z2 << "\n";
    of3 << current_time << " " << x3 << " " << y3 << " " << z3 << "\n";
    of4 << current_time << " " << x4 << " " << y4 << " " << z4 << "\n";
  }

  of1.close();
  of2.close();
  of3.close();
  of4.close();

  return 0;
}
